import React from 'react';
import { Link } from 'react-router-dom';
import "./Welcome.css"
import RecentlyWatchedMovie from './RecentlyWatchedMovie';

const Welcome = () => {

    return (
        <div>
            <body>
                <div class="container">
                    <img 
                    className="imglogo" 
                    src="https://fontmeme.com/permalink/210115/72a4a804c01a2fa22cb39362f6132c1d.png" 
                    alt="PickFlix" />
                    <Link to="/login">
                        <button variant="contained" class="logobutton" >Enter</button>
                    </Link>
                </div>
            </body>
            <RecentlyWatchedMovie/>
        </div>
    )

};

export default Welcome;
